const HomeScreen = () => {
  const navigation = useNavigation();

  return (
    // <SafeAreaView style={{}}>
        <View style={{backgroundColor: 'lightblue', flexDirection: 'row', padding: 12}}>
            <Feather name="search" size={24} color="black" />
